import React, { Component } from 'react';
import axios from 'axios';

import './App.css';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      dogs: [],
      selectedBreed: null,
      greeting: 'Select a dog breed.',
      isLoading: true
    }; //state
  } //constructor

componentDidMount() {
    axios.get(`https://dog.ceo/api/breeds/list/all`)
      .then(res => {
        const dogs = res.data;
        this.setState({ dogs });
      })
  } //componentDidMount

  render() {
    return (
      <React.Fragment>
      <header> <h1>They Are Good Dogs, Brent</h1> </header>
      <body>
    <div class="good-dogs">

      { this.state.dogs.message }

    </div>
    </body>
    </React.Fragment>
  );



  } //render
} // App

export default App;
